Многие зарубежные исполнители отменили концерты в России:

— Игги Поп и группа The Killers не будут выступать на фестивале Park Live этим летом в Москве;

— Green Day отменила выступление в Москве 29 мая;

— Отменила концерт и группа Franz Ferdinand (планировался на Adrenaline Stadium 1 июля)

⚡️Заявления главы Минобороны Сергея Шойгу: 

— «Российская армия продолжит специальную военную операцию в Украине вплоть до достижения поставленных целей. Защита России от военной угрозы со стороны Запада является главной задачей»;
— «Российская армия не оккупирует украинскую территорию, принимает все меры для сохранения жизни и безопасности мирных жителей»;
— «Удары наносятся только по военным объектам и исключительно высокоточным оружием;
— Минобороны России проведёт в августе Первый Международный антифашистский конгресс.

⚡️Полностью санкции Великобритании:

— Гражданам Великобритании не рекомендуется совершать поездки в Россию из-за проблем с авиасообщением и волатильностью экономики;
— Лондон призывает Москву обеспечить гуманитарный доступ в Украине и коридоры для беженцев;
— Сделаны первые шаги к полному отключению РФ от SWIFT;
— Активы ВТБ, Совкомбанка, Внешэкономбанка заморожены;
— Готовятся санкции против Сбербанка;
— Недвижимость и яхты российских олигархов могут быть в скором времени арестованы;
— Глава Минтранса попросил порты не предоставлять доступ никаким судам под российским флагом.

Основные тезисы заявления главы Центробанка Эльвиры Набиуллиной:

— Финансовая система и экономика России сталкиваются с нестандартной ситуацией;
— Новые санкции ограничили возможности Банка России использовать резервы, поэтому он не проводил сегодня валютные интервенции;
— Банк России также смягчит выдачу ипотеки и необеспеченных потребительских кредитов;
— Все российские банки будут выполнять обязательства перед клиентами, все деньги на счетах доступны, отметила глава ЦБ; 
— «Российская Система передачи финансовых сообщений сможет заменить SWIFT, российская финансовая инфраструктура будет работать бесперебойно»;
— «Карты международных платежных систем продолжают работать внутри России».

Основные тезисы нового заявления Минобороны России:

— В «специальной военной операции» в Украине от российских вооруженных сил принимают участие только офицеры и военнослужащие по контракту;
— Все населённые пункты, перешедшие под контроль российских вооружённых сил, продолжают жить в обычном режиме;
— Большинство администраций городов по договорённости с Россией совместно обеспечивают правопорядок и поддерживают мирную жизнь.

⚡️Заявления Минфина:

— В бюджете есть ресурсы для выполнения социальных обязательств в текущих условиях. Государство выполнит все социальные обязательства в полном объеме, сказал Силуанов;

— при необходимости будут приняты меры по докапитализации банков;

— Минфин заявил, что подготовил предложение о проведении более масштабной амнистии капитала.

⚡️Заявления генерального секретаря НАТО Йенса Столтенберга:

— Генсек заявил, что полностью доверяет Зеленскому в вопросе ведения переговоров в Гомельской области;

— Заявления России о приведении в особый режим сил сдерживания подчеркивают важность единства НАТО и показывают серьёзность ситуации;

— НАТО наращивает поставки Украине противовоздушных и противотанковых систем;

— НАТО не видит в России «неизбежную» угрозу своей безопасности, но считает, что её действия стали заметно более агрессивными.

⚡️Заявление ЦБ РФ после новых санкций: 

▪️Банк России располагает необходимыми ресурсами и инструментами для поддержания финансовой стабильности и обеспечения операционной непрерывности финансового сектора;
▪️Банк России будет непрерывно предоставлять банкам наличную и безналичную ликвидность в рублях;
▪️ Все средства клиентов на счетах сохранены и доступны в любой момент времени;
▪️Банковские сервисы предоставляются в обычном режиме. Банковские карты всех банков на территории России также продолжают работать нормально;
▪️Передачу финансовых сообщений внутри страны при любом сценарии развития событий обеспечивает Система передачи финансовых сообщений (СПФС) Банка России.

⚡️Лукашенко выступил с заявлением. Главное: 

— В Украине нет ни белорусских солдат, ни вооружения, ни боеприпасов, России и не нужна такая помощь;
— Надо прекратить войну. Я бы даже не назвал это войной. Это конфликт. День-два - будет война. А через три дня - мясорубка;
— Конфликт в Украине - цветочки, если продолжит развиваться, будут ягодки;
— С юга Беларуси в начале конфликта было два или три ракетных удара, поскольку Киев развернул несколько ракетных дивизионов у границы;
— Беларусь помогает раненым на украинской границе;
— Все ждут в Гомеле делегацию Украины, если не приедут — это их выбор

Выступление главы Еврокомиссии:

— ЕС отключит некоторые российские банки от SWIFT. Среди них все, что уже попали под санкции;
— Страны Запада ограничат возможности Банка России по поддержке рубля за счет международных финансовых операций;
— ЕС заморозит активы Центробанка России ($643 млрд). 
— Возможность для россиян получить европейское гражданство в обмен на инвестиции будет ликвидирована;
— Евросоюз будет также работать над тем, чтобы запретить российским олигархам использовать финансовые активы на рынках.

Что произошло за ночь: 

— Владимир Зеленский сообщил, что ночью российские войска начнут штурм Киева;
— В районе трех часов ночи в Киеве и пригородах стали раздаваться взрывы, на улицах стала слышна стрельба; 
— Местные СМИ сообщают, что самые ожесточенные бои шли на проспекте Победы в районе Шулявки;
— Стрельба также была в центре Киева, в том числе на улице Богдана Хмельницкого и рядом с Крещатиком, в 4 километрах от офиса Владимира Зеленского,
— Сейчас во многих украинских городах объявлена воздушная тревога — Херсона, Львове, Луцке, Ровенской области, Черкассах. В городе Суммы, по данным местных СМИ, также велись ожесточенные бои — российское Минобороны, однако, заявляет о блокировке города.
— Владимир Зеленский, по информации некоторых изданий, остается в Киеве и сам руководит обороной города.

Twitter ввёл меры против фейков и оскорблений:

— для пользователей из России и Украины ограничили рекомендации твитов от тех, на кого люди не подписаны;
— владельцев уязвимых профилей попробуют защитить от взломов и манипуляций;
— советы по цифровой безопасности для пользователей в зонах конфликтов теперь находятся на главной странице.

Главное по антивоенным акциям, которые проходят по всей России:

— Люди вышли в десятках городов по России под единым лозунгом «Нет войне», который звучит от протестующих и написан на плакатах;
— В Москве и Санкт-Петербурге — самые массовые акции. В Москве часть протестующих стоит на Пушкинской. В Петербурге протестующие стоят вдоль всего Гостиного двора;
— На акции вышел Оксимирон, задержали рэпера — Локимина;
— В Москве — 290 задержанных, в Петербурге — 128. По информации СМИ, задержали уже более 650 человек в 39 городах.

Песков заявил, что цель России — денацификация Украины: в идеале — зачистить страну от нацистов;

По словам пресс-секретаря, сроки российской операции по демилитаризации Украины будут определяться Путиным и зависеть от ее результативности, целесообразности;

У России могут возникнуть проблемы с целым рядом государств из-за ситуации на Украине, но трудности с ними возникали и без этого;

Ситуация обязывает к повышенному уровню бдительности и безопасности;

Песков о возможности переговоров Путина и Зеленского: почему бы и нет, если Украина готова говорить об озабоченностях Москвы в сфере безопасности;

❗️Официально. Санкции Евросоюза за признание Россией ДНР и ЛНР вступили в силу. Опубликованы списки лиц, которых они коснулись. 

В их числе: 
— министр обороны РФ Сергей Шойгу;
— представитель МИД Мария Захарова;
— глава администрации президента Антон Вайно;
— глава RT Маргарита Симоньян;
— телеведущий Владимир Соловьёв; 
— бизнесмен Евгений Пригожин. 

Всем, кто попал под санкции, запрещается въезд в страны Евросоюза, их активы на территории ЕС заморозят.
